Alternative Testing
Clonezilla live 20111013-oneiric
	* The underlying GNU/Linux operating system was upgraded. This release is based on the Ubuntu Oneiric repository (as of 2011/Oct/13).
	* Partclone was updated to 0.2.31. This release supports VMFS5 imaging and cloning.
	* Gdisk was updated to 0.8.1.
	* Bug fixed: A bug with assigning NFS version 2 / 3 protocol to mount NFS image repository, NFS4 might be automatically used was fixed. Thanks to darstra for this bug report.

